    'comment': 'В данную рубрику следует вносить организации, которые производят, продают встроенные пылесосы, а также проводят монтаж и обслуживание систем центрального пылеудаления. Системы центрального пылеудаления - встроенный пылесос устанавливается за пределами жилой зоны (подвал, балкон и пр). По дому разводится трубопровод и устанавливаются пневморозетки. Уборка производится шлангом, подключенным в пневморозетку. При такой системе отсутствует рециркуляция загрязненного воздуха, пыль выводится на улицу.',
