    'name': 'Нефтяные резервуары',
    'comment': 'В данную рубрику следует вносить организации, которые строят, продают нефтяные резервуары, а также компании, которые проводят их обслуживание (ремонт, очистка и т.п.) Нефтяные резервуары — это емкости для хранения нефти и нефтепродуктов. В зависимости от материала, из которого сооружают резервуары, их подразделяют на металлические (стальные) и неметаллические. Если организация предоставляет услуги по антикоррозийной, огнезащитной обработке ТОЛЬКО нефтяных резервуаров, то дополнительно рубрики Антикоррозийная обработка металлоконструкций, Огнезащитная обработка НЕ УКАЗЫВАТЬ. НЕ ПУТАТЬ с рубриками Антикоррозийная обработка металлоконструкций, Огнезащитная обработка.',
