    'comment': 'В данную рубрику следует вносить медицинские организации, у которых имеются услуги врача-гастроэнтеролога. Врач-гастроэнтеролог оказывает услуги по лечению заболеваний органов ЖКТ (гастрит, язвенная болезнь желудка и т.п.)',
