    'name': 'Системы денежных переводов',
    'comment': 'В данную рубрику следует вносить системы денежных переводов, с помощью которых можно перевести деньги из одного города (страны) в другой. НЕ СТАВИТЬ дополнительные рубрики! Если на адресе главного офиса есть пункт, через который можно осуществить денежный перевод, допустимо указывать рубрику Пункты денежных переводов. Заводим карточку с названием самой системы, указываем адрес главного офиса (представительства данной системы в конкретном городе), телефон единой справочной, сайт (на котором указаны адреса, где осуществляется перевод по конкретной системе) и другую контактную информацию. В случае отказа указания адреса офиса, допустимо оставить карточку без адреса. Не вносите в данную рубрику сами банки и их адреса, где действует данная система перевода денежных средств. Разрешается вносить адреса доп.офисов, по которым проводят денежные переводы только по своей системе. Не вносить адреса доп. офисов, находящихся в банке.',
