  '21466': {
    'id': '21466',
    'name': 'Саморегулируемые организации (СРО)',
    'comment': 'В данную рубрику следует вносить саморегулируемые организации (СРО), к таким относятся - организации, созданные на базе некоммерческого партнерства, объединяющие в себе юридических лиц и ИП на принципах саморегулирования и добровольности. СРО выдают допуск на осуществление строительной / проектной / изыскательной деятельности организациям, которые стали членами СРО, вступив в него. В данную рубрику можно вносить строительные СРО, проектные СРО, СРО по изыскательной деятельности, СРО аудиторов, СРО в области пожарной безопасности, СРО арбитражных управляющих, СРО оценщиков и пр. Данную рубрику НЕДОПУСТИМО указывать следующим организациям: 1. Коммерческим организациям, т.к. коммерческая организация не может приобрести статус СРО; 2. Юридическим / консалтинговым компаниям, которые оказывают помощь в получении допуска (сбор документов, консультация, передача документов в СРО); 3. Членам СРО (организации, которые вступили в СРО); 4. Представителям СРО. Недопустимо указывать дополнительные рубрики, потому как СРО не могут осуществлять предпринимательскую деятельность.',
    'keywords': 'Допуск на строительство, Допуск СРО, Лицензии на строительство, Проектные СРО, Саморегулируемая организация строителей, Саморегулируемая строительная организация, Саморегулируемые организации, Саморегулируемые организации строителей, Саморегулируемые строительные организации, Свидетельство о вступлении в СРО, Свидетельство СРО, СРО, СРО арбитражных управляющих, СРО изыскателей, СРО проектирование, СРО строителей, Строительная саморегулируемая организация, Строительные лицензии, Строительные СРО, Членство в СРО',
    'second_level_name': 'Юридические услуги',
    'first_level_name': 'Юридические / финансовые / бизнес-услуги',
    'is_commodity': false
  },
