    'name': 'Инженерные службы',
    'comment': 'В данную рубрику следует вносить инженерные службы. Инженерные службы - это учреждения, которые занимаются: начислением платежей только за отопление (остальные платежи начисляет ЕИРЦ), уборкой внутридворовых территорий; поддержанием в рабочем состоянии подъемников для маломобильных групп населения; работой с жилищными объединениями (например: ТСЖ) и управляющими организациями и т.п.. Не путать с рубрикой Пункты приёма платежей / Расчётные центры коммунальных услуг. НЕ СТАВИТЬ дополнительные рубрики.',
