    'name': 'Кинооборудование – аренда, продажа',
    'comment': 'В данную рубрику следует вносить специализированные организации, которые производят, продают и / или сдают в аренду / прокат кинооборудование. Кинооборудование - это оборудование, аппаратура, технические приспособления и запасные части к ним, используемые при производстве фильмов, производстве кинолетописей, тиражировании фильмов, прокате / показе фильмов. Если компания занимаются только прокатом / арендой кинооборудования, то рубрику Прокат мультимедийного / презентационного оборудования НЕ СТАВИТЬ. Если компания занимается производством / продажей дополнительных устройств к оборудованию, то рубрика подходит.',
