    'name': 'Обучение массажистов',
    'comment': 'В данную рубрику следует вносить организации, которые проводят курсы обучения массажа (обучение с нулевого уровня). Как правило, после окончания курсов выдается свидетельство. Если организация проводит семинары для массажистов / косметологов (уже прошедшие обучение), рубрику НЕ СТАВИТЬ. Не путать с рубриками Услуги массажиста, Профессиональная переподготовка / Повышение квалификации, Обучение мастеров для салонов красоты.',
