    'name': 'Услуги водителя без автомобиля',
    'comment': 'В данную рубрику следует вносить организации, которые предоставляют услуги водителя без транспортного средства (автомобиля). Принцип работы: клиент может арендовать водителя для управления своего транспортного средства. Например: клиент не может управлять своим транспортным средством, по некоторым обстоятельствам, звонит в данную организацию, заказывает только водителя, который доставляет его до нужного места. Не путать с рубрикой Заказ легковых такси',
    'keywords': 'Водитель на час, Вызов водителя, Заказ водителя, Пьяный водитель, Трезвый водитель, Услуги водителя, Услуги пьяных водителей, Услуги трезвых водителей',
