    'name': 'Участковые пункты полиции',
    'comment': 'В данную рубрику следует вносить участковые пункты полиции. Одна из главных задач УПП - профилактика правонарушений в жилом секторе. Фактически они являются аналогом упраздненных ранее общественных пунктов охраны порядка. УПП представляет собой отдельное помещение, в котором дежурят участковый уполномоченный, его помощник и представители общественности. УПП также занимаются делами несовершеннолетних (т.е. инспекторы). НЕ СТАВИТЬ дополнительные рубрики! Если в Опорном пункте полиции располагается только участковый, рубрику ставим Участковые пункты полиции. Если в Опорном пункте полиции располагаются участковый и другие представители правоохранительной власти (куда пользователь может обратиться с жалобой об ограблении или жалобой на соседа; если у него произошла кража, вызвать наряд полиции и т.п. ), то данная рубрика ПОДХОДИТ.',
    'keywords': 'Милицейский участок, Милиция, Опорные пункты полиции, Опорный пункт милиции, Полиция, Пункт милиции, Пункт полиции, УПМ, УПП, Участковые, Участковые пункты милиции, Участок милиции, Участок полиции',
