    'name': 'МФЦ',
    'comment': 'В данную рубрику следует вносить многофункциональные центры предоставления государственных и муниципальных услуг населению (МФЦ). МФЦ — российская организация независимо от организационно-правовой формы, отвечающая установленным требованиям, и уполномоченная на организацию предоставления государственных и муниципальных услуг, в том числе в электронной форме, по принципу "одного окна". Данные организации включают в себя: центр занятости населения, отдел государственной инспекции труда, управления федеральной миграционной службы, отдел юстиции, фонд развития малого и среднего предпринимательства и т.п. Не путать с рубриками Социальные службы, Службы занятости населения, Федеральные службы, Налоговые инспекции и т.п. НЕ СТАВИТЬ дополнительные рубрики.',
