    'name': 'Курсы вокала',
    'comment': 'В данную рубрику следует вносить специализированные организации, которые проводят курсы вокального мастерства. Такие организации могут также предоставлять услуги по обучению базовых основ музыкального мастерства сольфеджио. Сольфеджио — начальные вокальные упражнения в чтении нот без текста. Если в организации подготавливают детей в разных направлениях: музыкальных, художественных, хореографических и т.п., то указываем только одну рубрику Школы искусств. НЕ ПУТАТЬ с рубриками Школы искусств, Личностные тренинги / семинары, Профессиональная переподготовка / Повышение квалификации, Театральные курсы.',
