    'name': 'Туалеты',
    'comment': 'Вносить СТАЦИОНАРНЫЕ платные / бесплатные туалеты, которые располагаются в отдельных помещениях, а также расположенные в ТЦ, АЗС, супермаркетах, на вокзалах, рынках и т.д. Данные помещения являются общественными местами пользования. Не ставить дополнительные рубрики, кроме Общественный душ. Рубрика не подходит, если в заведениях общепита есть общественный туалет, указывать ДА Общественный туалет. НЕ ВНОСИТЬ туалеты, расположенные в медицинских, образовательных учреждениях, организациях из рубрик 1го уровня Город / Власть, персональные кабины и биотуалеты, а также туалеты рядом или внутри заведения общественного питания и предназначенные ТОЛЬКО ДЛЯ ПОСЕТИТЕЛЕЙ данных заведений (т.е. воспользоваться им ОТДЕЛЬНО от остальных услуг компании НЕЛЬЗЯ). В медицинских, образовательных учреждениях с ЭТАЖАМИ (например, больницах, университетах и т.п.) обязательно указывать ДА Доступ ограничен. ВАЖНО. Если указан ДА Доступ ограничен, то ДА Платный / Бесплатный туалет НЕ УКАЗЫВАТЬ. Рубрика НЕ ПОДХОДИТ, если компания производит / продает туалеты.',
    'keywords': 'WC, Xojathona, Городской туалет, Общественные туалеты, Стационарные туалеты, Туалет, Туалетные кабинки, Туалетные кабины, Хожатхона',
