    'name': 'Косметика ручной работы',
    'comment': 'Вносить организации, которые производят / продают косметику ручной работы. Косметика ручной работы - это средства для ванны изготовленные вручную (преимущественно из натуральных продуктов и м.б. с добавлением различных эфирных масел, кусочками фруктов, крема и др. добавками): мыло, пенящиеся «бомбы», массажные плитки, шампуни, пены, гели, средства для умывания, лосьоны, кремы, скрабы. Такая косметика продается в специализированных магазинах на разновес, а мыло кусочками любого размера, которое отрезается особым ножом и взвешивается на весах. НЕ СТАВИТЬ с рубрикой Сырьё для производства косметики / бытовой химии.',
