  '54050': {
    'id': '54050',
    'name': 'Нотариальные палаты',
    'comment': 'В данную рубрику следует вносить нотариальные палаты города / области. Нотариальная палата - это некоммерческая организация, представляющая собой профессиональное объединение, которое основано на обязательном членстве нотариусов, занимающихся частной практикой, и организующая работу на принципах самоуправления. Нотариальная палата оказывает помощь нотариусам в повышении квалификации, проводит семинары, выпускает сборники нормативных и информативных материалов, помогает в совершенствовании технического обеспечения нотариальных контор, осуществляет постоянный контроль за работой нотариусов, включая страхование нотариальной деятельности. Также нотариальные палаты могут принимать жалобы на действия нотариусов от населения. Не путать с рубрикой Общественные организации. Не ставить дополнительные рубрики.',
    'keywords': 'Нотариальная палата, Палата нотариальная, Профессиональное объединение нотариусов',
    'second_level_name': 'Общественные / политические организации',
    'first_level_name': 'Город / Власть',
    'is_commodity': false
  },
