    'name': 'Настольные игры',
    'comment': 'В данную рубрику следует вносить организации, которые производят / продают настольные игры. Если в магазине представлен небольшой ассортимент настольных игр, как, например, в магазине игрушек, то рубрика не подходит. Настольная игра — игра, основанная на манипуляции относительно небольшим набором предметов, которые могут целиком разместиться на столе или в руках играющих. В число настольных игр входят игры со специальным полем, карточные игры, кости, солдатики и другие. Игры данной категории, в отличие от спортивных и видеоигр, не требуют активного перемещения игроков, наличия дополнительного технически сложного инвентаря или специальных сооружений, игровых площадок, полей и т. п. Если компания продает покерные наборы и столы для покера, то им подходит рубрика Игорное оборудование / Аксессуары. Не путать с рубриками Сувениры, Игрушки, Игорное оборудование / Аксессуары.',
