    'name': 'Сорбенты',
    'comment': 'Следует вносить организации, которые производят / продают сорбенты / адсорбенты для ликвидации последствий техногенных катастроф, связанных с разливом нефти и нефтепродуктов. Сорбенты применяются и в качестве штатных средств для экологической безопасности на АЗС, для очистки технической воды, применяемой в промышленности, а также применяются в сфере медицины для производства активированного угля. Применение технологии щадящего устранения последствий аварий с помощью волокнистых сорбентов, позволяют снизить отрицательные последствия для экологии. Сорбенты - твердые тела или жидкости, избирательно поглощающие (сорбирующие) из окружающей среды газы, пары или растворенные вещества. Адсорбенты – это вещества, обладающие способностью адсорбции, т. е. поглощения, всасывания какого-либо другого вещества из раствора или из газа только своей поверхностью. Не путать с рубрикой Сырье для лекарственных средств.',
