    'comment': 'Следует вносить организации, которые оказывают посреднические услуги в регистрации / перерегистрации лекарственных средств. Регистрация лекарственных средств включает в себя: составление регистрационного досье; подача документов в НЦЭСМП; проведение экспертизы товарного названия препарата; подача документов для экспертизы качества и безопасности препаратов; передача документов, прошедших экспертизу из НЦЭСМП в Федеральную Службу по надзору в сфере здравоохранения и социального развития для принятия решения о выдаче Регистрационного удостоверения. Как правило, организации могут предоставлять свои услуги как в комплексе на всех этапах, так и по каждому этапу отдельно. Все лекарственные препараты должны быть внесены в Государственный реестр лекарственных средств, а производителям выдается Регистрационное удостоверение. Регистрационное удостоверение – это документ подтверждающий допуск лекарственного средства к производству, импорту, продаже и применению на территории Российской Федерации.',
    'keywords': 'Регистрационное удостоверение лекарственных средств, Регистрация БАД, Регистрация биологически активных добавок, Регистрация лекарств, Регистрация лекарственных препаратов, Регистрация лекарственных средств',
