    'keywords': 'Бижутерия из войлока, Валенки, Валяние валенок, Валяные изделия, Войлочные аксессуары, Войлочные изделия, Войлочные тапочки, Обувь валяная, Производство валенок, Производство валяной обуви, Производство войлочных изделий, Сумки из войлока, Тапочки из войлока',
