    'keywords': 'Газогеохимические исследования, Инженерно-экологические изыскания, Инженерно-экологические исследования, Инженерные изыскания, Инженерные изыскания для строительства, ИЭИ, Камеральные работы, Почвенные исследования, Радиационные измерения, Радиационные исследования, Экологические изыскания, Экология, Эколого-гидрогеологические работы',
