    'comment': 'Вносить авиатакси, т.е. услуги аренды самолета / вертолета с пилотом для перевозки пассажиров, например, из города в город или для перевозки вахтовиков на место вахты и т.п. Данные организации, могут иметь свой парк воздушного транспорта или сотрудничать с авиакомпаниями, которые предоставляют свой воздушный транспорт. Рубрика НЕ ПОДХОДИТ авиакомпаниям, которые занимаются ТОЛЬКО постоянной перевозкой пассажиров (т.е. имеют постоянное расписание рейсов в разные направления, на которые можно купить билет). Если у авиакомпании, помимо постоянной перевозки пассажиров, есть услуга авиатакси самолетов и вертолетов любому желающему, то рубрика подходит. Если компания совершает ТОЛЬКО прогулочные экскурсионные полеты на вертолете / самолете, то рубрика НЕ ПОДХОДИТ, указывать рубрику Авиационные клубы. Не путать с рубриками Авиагрузоперевозки, Авиакомпании, Авиационные клубы.',
