    'comment': 'Следует вносить организации, которые оказывают комплексные услуги по изготовлению объемных и мягких декораций, различных сценических конструкций и конструкций для сценических эффектов, бутафории, скульптур, мебели, реквизита, которые применяется в театрах, на сцене, на телевидение и т.п. Если организация занимается изготовлением декораций из воздушных шаров, рубрика не подходит. Возможно, клиенту подходит также / или рубрика Сценические / карнавальные костюмы.',
