    'comment': 'В данную рубрику следует вносить организации, предоставляющие услуги врачей-онкологов. Онколог – это врач, занимающийся диагностикой и лечением предраковых и раковых заболеваний, таких как: меланома, рак желудка, рак кожи, рак легкого, опухоли мочевых путей, опухоли сердца и т.п. Если у организации, прием ведет только маммолог, онколог-маммолог, то указываем одну рубрику - Услуга маммолога. Если прием ведут два разных врача (маммолог и онколог-хирург, например), то указываем рубрики Услуги онколога и Услуги маммолога.',
