    'comment': 'В данную рубрику следует вносить организации, которые производят / продают унты. Если обувной магазин, наряду с обычной обувью, продает унты, рубрика НЕ ПОДХОДИТ. НЕ СТАВИТЬ с рубрикой Обувные магазины. Допустимо ставить с рубрикой Спецобувь в том случае, когда имеется большой ассортимент как унт, так и спецобуви (медицинская обувь, болотные сапоги, защитная обувь и т.д.). Допустимо ставить с рубриками Производство обуви, Обувь - опт в том случае, когда имеется большой ассортимент как унт, так и повседневной обуви (туфли, сапоги, тапочки и т.д).',
