    'name': 'Музыкальные курсы',
    'comment': 'В данную рубрику следует вносить организации, центры, школы, где проводят индивидуальные / групповые занятия по обучению игры на различных музыкальных инструментах. Занятия проводятся для всех желающих не зависимо от возраста и наличия музыкального образования. Как правило, в таких компаниях предполагается базовое обучение нотной грамоте для дальнейшей игры на музыкальном инструменте. В курс обучения не входят основы музыкально-теоретических дисциплин, а также дисциплины, предназначенные для развития музыкального слуха и музыкальной памяти. По окончанию курсов дипломы, аттестаты и т.п. государственного образца НЕ ВЫДАЮТСЯ.',
