    'name': 'Избирательные участки',
    'comment': 'В данную рубрику следует вносить Избирательные участки. Избирательный участок — территориальная единица, образуемая в период выборов и референдумов для проведения голосования и подсчёта голосов. На территории избирательных участков действуют участковые избирательные комиссии и составляются списки избирателей, обладающих активным избирательным правом на соответствующей территории. На избирательном участке можно получить открепительный бюллетень. Рубрика ставиться только на время проведения выборов. НЕ СТАВИТЬ дополнительные рубрики!',
    'keywords': 'Выборы, Избирательный участок, Проголосовать, Пункты голосования, УИК',
