    'keywords': 'Брикетировочные прессы, Инсинераторы, Компакторы, Оборудование для переработки мусора, Оборудование для переработки отходов, Оборудование для переработки шин, Оборудование для утилизации мусора, Пакетировочные прессы, Пресс для мусора, Пресс для отходов, Промышленный шредер, Ремонт оборудования для переработки отходов, Ремонт оборудования для утилизации отходов, Рециклинговые установки, Шредеры для мусора, Шредеры для отходов',
