  '57354': {
    'id': '57354',
    'name': 'Создание субтитров',
    'comment': 'В данную рубрику следует вносить организации, которые занимаются производством субтитров. Субтитры - это файл с текстом, который в определенное время выводится на экран, дублируя или дополняя происходящее на экране. Это может быть перевод того, что говорят на экране, с одного языка на другой. А может быть просто «расшифровкой» того, что говорит персонаж на том же языке, на котором он говорит. Субтитр появляется на экране одновременно с произносимой фразой, или словом, и исчезает, когда фраза или слово перестают звучать. Субтитры, как правило, используются: 1. для перевода – для того, чтобы слышать язык оригинала. 2. для расшифровки – для слабослышащих или глухих зрителей.',
    'keywords': 'Производство субтитров, Субтитрирование, Субтитры',
    'second_level_name': 'Рекламные услуги',
    'first_level_name': 'Реклама / Полиграфия / СМИ',
    'is_commodity': false
  },
