    'comment': 'В данную рубрику следует вносить специализированные компании, которые занимаются обслуживанием (очисткой, откачкой, прочисткой) выгребных ям, а так же его устройством для всех категорий пользователей. Организации имеют свой парк специализированных автомобилей. Если организации занимаются строительством / обслуживанием наружных и внешних систем канализации и на промежуточной стадии оказывают услуги очистки, прочистки канализации, септиков загородных районов и т.п. – рубрику НЕ СТАВИТЬ. Если организация занимается строительством дач, коттеджей и т.п., и на промежуточной стадии занимаются строительством / устройством / обслуживанием выгребных ям, рубрику НЕ СТАВИТЬ. Не путать с рубриками Строительство / обслуживание наружных систем отопления / водоснабжения / канализации, Обслуживание внутренних систем отопления / водоснабжения / канализации, Заказ строительной / спецавтотехники, Утилизация отходов / Переработка вторсырья. НЕ СТАВИТЬ с рубрикой Аварийные службы, Жилищно-коммунальные услуги, Службы спасения / экстренного вызова.',
