    'name': 'Изготовление фотокниг',
    'comment': 'В данную рубрику следует вносить организации, которые оказывают полный комплекс услуг по разработке и производству фотокниг. Фотокнига – это книга на определенную тему (свадебную, детскую, выпускную тематику и т.п.), объединенная оригинальным дизайном, каждая страница которой представляет собой обработанные фотографии, комментарии к ним и / или художественные элементы. Фотокниги не продаются в магазинах, они изготавливаются индивидуально для каждого. Если фотоцентр / фотостудия оказывает полный комплекс услуг по разработке и производству фотокниг (разработка оригинал-макета, печать разворотов и обложки, сборка внутреннего блока, сборка корки и т.п.), то рубрика подходит. Если компания занимается только печатью фотокниг, не предоставляя при этом услуг по дизайну, верстке, брошюровке и т.п., то подходит рубрика Полиграфические услуги. Данным компания рубрику Изготовление фотокниг НЕ СТАВИТЬ.',
