    'name': 'Защитные кейсы',
    'comment': '"В данную рубрику следует вносить организации, которые производят / продают защитные кейсы. К защитным кейсам относятся водонепроницаемые, ударопрочные кейсы, изготовленные из сверхпрочного материала (сополимерного пропилена), который позволяет полностью защитить находящееся внутри содержимое. Такие кейсы могут иметь возможность установки мягких модульных перегородок, с помощью которых организовывается пространство и которые можно ориентировать в любом положении. Защитные кейсы предназначены для использования в качестве защитного корпуса для переносных устройств и приборов (оборудования для погружения, оборудование для фото и видео съемки и т.п.), их хранения и транспортировки. Если в магазине сумок / чемоданов есть в ассортименте бытовые кейсы (дипломаты), то данная рубрика НЕ ПОДХОДИТ."',
