    'name': 'Центры иммунизации',
    'comment': 'В данную рубрику следует вносить медицинские центры, которые предоставляют большой перечень услуг вакцинации (вакцинация детей и беременных, вакцинация от рака, вакцинация для выезжающих за границу и т.п.). Если организация оказывает услугу только по вакцинации от гриппа или клеща, рубрика НЕ ПОДХОДИТ. Не путать с рубрикой Услуги аллерголога / иммунолога.',
    'keywords': 'Вакцина, Вакцинация, Вакцинация взрослых, Вакцинация детей, Вакцинирование, Вакцинопрофилактика, Детские прививки, Диаскин тест, Диаскинтест, Места вакцинации, Поставить прививку, Прививка АДСМ, Прививка АКДС, Прививка ВПЧ, Прививка от бешенства, Прививка от гепатита, Прививка от гриппа, Прививка от дифтерии, Прививка от клеща, Прививка от клещевого энцефалита, Прививка от коклюша, Прививка от менингита, Прививка от пневмонии, Прививка от столбняка, Прививка от энцефалита, Прививки, Прививки БЦЖ, Прививки взрослым, Прививки детям, Прививки от аллергии, Прививки от жёлтой лихорадки, Прививки от полиомиелита, Прививочные кабинеты, Пункт серопрофилактики, Пункты вакцинации, Пункты серопрофилактики, Реакция Манту, Ревакцинация, Сделать вакцину, Серопрофилактика, Услуги вакцинации, Центры вакцинации',
    'second_level_name': 'Медицинские услуги',
