    'comment': 'Вносить специализированные компании, которые оказывают услугу кемпинга. Услуга кемпинга подразумевает специализированную огражденную территорию для проживания на свежем воздухе в автодомах, палатках и т.п. На данный территории имеется общественный туалет, душ и т.п. НЕ СТАВИТЬ с рубриками Бронирование гостиниц, Туристические агентства. НЕ СТАВИТЬ с рубриками общепита, подробнее см документ Разделение карточек в сфере Общественное питание. Если на территории кемпинга есть кафе / ресторан, то указывать ДА Кафе. Если у компании нет территории для проживания на свежем воздухе, а имеются только летние домики, рубрика Кемпинги НЕ ПОДХОДИТ, указывать рубрику Базы отдыха. Допустимо указывать с рубрикой Базы отдыха, если на территории базы отдыха имеется кемпинг. Допустимо указывать рубрики по услугам (баня, и т.п.), если ими могут воспользоваться все желающие, вне зависимости от основного направления (без проживания в кемпинге). Если на территории кемпинга сдают в аренду автодома, то рубрику Продажа / прокат автодомов НЕ СТАВИТЬ. Не путать с рубрикой Базы отдыха.',
