    'name': 'Товары для праздничного оформления / организации праздников',
    'comment': 'В данную рубрику следует вносить организации, которые производят / продают товары для оформления и организации праздника (воздушные шары, конфетти, плакаты, растяжки и т.д.). Если в магазине игрушек, свадебных, детских, книжно-канцелярских товаров и т.п. имеется ассортимент товаров для оформления праздников, то рубрика подходит. Если праздничное агентство занимается продажей товаров для праздника для всех желающих (имеют большой выбор товара), не зависимо от заказанных услуг, то рубрика подходит. Если компания специализируется на товарах с новогодней тематикой, то указывается рубрика Новогодние товары, дополнительно Товары для праздничного оформления / организации праздников НЕ СТАВИТЬ. Если организация занимается товарами для различных праздников (юбилеи, свадьбы, день рождения и т.п.), то рубрику Свадебные товары НЕ СТАВИТЬ. Если компания занимается продажей газа для воздушных шариков, то рубрику Технические газы / Криогенные жидкости НЕ СТАВИТЬ! Указывать ДА Гелий для шаров. Не путать с рубриками Услуги праздничного оформления, Организация и проведение праздников.',
