    'name': 'Металлы / Сплавы',
    'comment': 'В данную рубрику следует вносить организации, которые производят металлы из природного сырья и других металлсодержащих продуктов (выплавка металлов), а так же производство различных сплавов (сплавы алюминия, хрома, меди, железа, магния, никеля, титана и цинка). Если организация производит металлы из природного сырья и т.п., потом продает эти металлы / сплавы другим компаниям, которые производят различный металлопрокат (это уже готовый товар: трубы, листы, проволока и т.п.), то рубрика ПОДХОДИТ. Если организация наряду с производством / выплавкой самих металлов, производит различный металлопрокат, то рубрики так же подходят по металлопрокату (Цветной металлопрокат, Черный металлопрокат). Если организация занимается приемом, переработкой, утилизацией металлома, то рубрика НЕ ПОДХОДИТ. Если компания занимается литейным производством различных изделий на заказ, то подойдет рубрика Литейное производство. Не путать с рубриками Литейное производство, Приём / переработка металлолома, Цветной металлопрокат, Черный металлопрокат.',
