    'name': 'Массажное оборудование / приборы',
    'comment': 'Вносить организации, которые производят / продают массажное оборудование, приборы, аппараты (массажные кровати, подушки, массажеры, оборудование для массажистов и т.д.). НЕ СТАВИТЬ рубрику аптекам и магазинам, где имеется небольшой ассортимент массажеров. НЕ СТАВИТЬ рубрику организациям, которые специализируются на ручных немеханических массажерах, таких как роликовые массажеры. Если организация занимается производством / продажей оборудования для массажистов (кушетки), то рубрика подходит. Если компания оказывает услуги по ремонту массажного оборудования для всех желающих (не только в рамках гарантийного срока), то рубрика подходит. Если организация занимается производством / продажей велнес-тренажеров (тонусные столы, виброплатформы), то рубрика НЕ ПОДХОДИТ. Если организация продает офисные массажные кресла, рубрика Массажное оборудование / приборы НЕ СТАВИТЬ, указываем рубрику Офисная мебель',
