    'name': 'Резиновые покрытия / Комплектующие',
    'comment': 'В данную рубрику следует вносить производителей, торговые компании, специализированные магазины, которые производят / продают резиновые покрытия: бесшовные резиновые покрытия, резиновые плитки / брусчатки / бордюры - из резиновой крошки, рулонные покрытия, противоскользящие резиновые покрытия и т.п. Если компания оказывает услуги по заливке / укладке резиновых покрытый, то рубрика подходит. Если в ассортименте магазина / компании со строительными материалами встречается большой выбор резиновой плитки / брусчатки, рулонные резиновые покрытия, то рубрика подходит. Если компания занимается производством / продажей различных тротуарных плиток: бетонные, каменные и на ряду имеется резиновая плитка, то рубрика подходит. Не путать с рубриками «Напольные покрытия / комплектующие», «Тротуарная плитка», «Грязепоглощающие покрытия», «Резинотехнические изделия», «Строительство / ремонт дорог».',
