    'name': 'Киноаттракционы',
    'comment': 'В данную рубрику следует вносить Киноаттракционы. Киноаттракционы – это 4D-, 5D-, 6D-кинотеатры и т.п., которые представляют из себя небольшой кинозал, в котором сооружена динамическая платформа с гидромеханической конструкцией. Платформа рассчитана, как правило, на 4-7 кресел. Специальные эффекты брызг, движения воздуха, очки и т.п. Если в кинотеатре, наряду с обычными залами (2D, 3D и т.п.), имеются залы (не кабинка) с функцией 4D-, 5D-, 6D, то рубрика ПОДХОДИТ. Если на территории кинотеатра имеется киноаттракцион (не зал, а именно кабинка) и покупка билета осуществляется вне кассы кинотеатра, то рубрика ПОДХОДИТ. Не путать с рубриками Кинотеатры, Кинооборудование – аренда, продажа, Детские игровые залы / игротеки.',
