    'name': 'Услуга распила мяса',
    'comment': 'В данную рубрику следует вносить специализированные организации, которые предоставляют услугу распила туши животного, мяса. Если организация оказывает услуги распила мяса на выезде, то рубрика подходит. Если организация по продаже мяса оказывает услугу распила всем желающим, независимо от того, где оно куплено, то рубрика подходит. Не путать с рубрикой Услуга распиловки.',
