    'name': 'Междугородные / Международные пассажирские перевозки',
    'comment': 'В данную рубрику следует вносить организации, которые предоставляют услугу перевозки пассажиров по межгороду, а также по международному направлению. Данные организации имеют свой парк автобусов, микроавтобусов с водителями, постоянное расписание и производят регулярные рейсы по определенным маршрутам. Если у туристического агентства есть свой парк автобусов, которые совершают РЕГУЛЯРНЫЕ междугородние / международные рейсы (не обзорная автобусная экскурсия в другой город), есть постоянное расписание, телефон, по которому дают всю информацию о рейсе и данная услуга предоставляется отдельно от покупки путевок, то рубрика подходит. Если у организации можно заказать автобус для перевозки людей (в другой город, на свадьбу и т.п.), а собственного регулярного расписания нет, то указывать рубрику Заказ автобусов. Если компания оказывает услугу междугородних пассажирских перевозок, но рейсы прописаны в штатном расписании автовокзала (и отправляются с автовокзала с объявлением рейса диспетчером), то рубрика не подходит. Если компания (например, транспортная) занимается организацией автобусных перевозок и продает билеты только на свои рейсы, то рубрику Автобусные билеты НЕ СТАВИТЬ. Не путать с рубриками Заказ автобусов, Заказ легковых такси, Автобусные билеты. НЕ СТАВИТЬ с рубрикой Автовокзалы / Автостанции.',
    'keywords': 'Междугородное маршрутное такси, Междугородные пассажирские перевозки, Международные пассажирские перевозки, Пассажирские перевозки, Такси межгород',
    'second_level_name': 'Грузоперевозки / Транспортные услуги',
    'first_level_name': 'Транспорт / Грузоперевозки',
    'is_commodity': false
