  '104110': {
    'id': '104110',
    'name': 'Коворкинг',
    'comment': 'Коворкинг - центр, где можно арендовать рабочее место на необходимое время (час, день, месяц и т.д.). Коворкинг разделен на отдельные рабочие места с доступом в интернет, оборудован оргтехникой, переговорными комнатами. Не офисным коворкингам (столярным, бьюти-коворкингам и др.) рубрика подходит. Рубрика НЕ ПОДХОДИТ организациям, которые не являются коворкинг-центрами, а просто сдают 1-2 рабочих места в своем офисе. НЕ УКАЗЫВАТЬ рубрики по услугам, если они только для тех, кто арендует рабочее место (переговорная комната, тренинги, юр. и бух. поддержка и т.д.) Не путать с рубриками Аренда помещений, Конференц-залы, Антикафе.',
    'keywords': 'Аренда кабинетов, Аренда офисов, Аренда рабочих мест, Коворкинг-офисы, Поработать, Снять офис',
    'second_level_name': 'Недвижимость',
    'first_level_name': 'Строительство / Недвижимость / Ремонт',
    'is_commodity': false
  },
  '104196': {
    'id': '104196',
    'name': 'Процессинговые центры',
    'comment': 'В данную рубрику следует вносить специализированные организации, которые предоставляют процессинговые услуги. Процессинговый центр — компания, обеспечивающая информационное и технологическое взаимодействие между участниками расчётов. Процессинговый центр осуществляет деятельность по обработке и хранению информации, используемой при совершении платежных операций, и является посредником между банком и торговой организацией (супермаркетом, интернет-магазином и т.д.) или платёжной системой интернета. Наиболее распространены процессинг пластиковых карт и процессинг электронных платежей. Торговый эквайринг предполагает деятельность между банком и торговой точкой и включает в себя комплекс услуг: установка оборудования (POS-терминалы и т.п.), обучение персонала, предоставление необходимых расходных материалов, обслуживание оборудования (POS-терминалов и т.п.) и т.п. Интернет-эквайринг предполагает деятельность между банком и интернет-магазином или платёжной системой интернета и осуществляется через web-интерфейс (защищенное соединение) с возможностью выхода на страницу банка или платежной системы для авторизации карты клиента, также производится установка дополнительных программ с постоянным мониторингом на попытки «взлома» карт (программы защиты покупателей). Если у банка имеются процессинговые услуги для всех желающих и возможно подключение к другим банкам, то рубрика подходит. Не ставить с рубриками Платёжные системы интернета и Системы денежных переводов. Не путать с рубриками Продажа платёжных терминалов / информационных киосков, Оборудование для автоматизации торговли, Платёжные системы интернета, Системы денежных переводов. Процессинговые центры должны быть лицензированы ФСБ (запрашивается только у рекламодателей).',
    'keywords': 'Безналичный расчёт, Интернет-процессинг, Интернет-эквайринг, Обслуживание карт, Оплата картой, Приём карт к оплате, Процессинг, Процессинг пластиковых карт, Процессинг электронных платежей, Процессинговые услуги, Услуги процессинга, Эквайринг',
    'second_level_name': 'Банковские / финансовые услуги',
    'first_level_name': 'Юридические / финансовые / бизнес-услуги',
    'is_commodity': false
  },
