    'comment': 'В данную рубрику следует вносить организации, которые оказывают услуги по ремонту / установке сантехники, санфаянса, гидромассажного оборудования, оборудования для очистки воды и т.п. НЕ СТАВИТЬ с рубрикой Аварийные службы, Жилищно-коммунальные услуги, Службы спасения / экстренного вызова. Если организация монтирует только приобретенное у них оборудование, производит ремонт только в рамках гарантийного обслуживания - рубрика НЕ ПОДХОДИТ. Не путать с рубриками Строительство / обслуживание наружных систем отопления / водоснабжения / канализации, Обслуживание внутренних систем отопления / водоснабжения / канализации.',
