    'name': 'Аренда ж/д тупика',
    'comment': 'В данную рубрику следует вносить организации, которые предоставляют в аренду ж/д тупик. Как правило, данные организации оказывают услуги охраны, разгрузки/погрузки груза с использованием специального оборудования и т.п. Если организация оказывает услуги аренды спецтехники для различных работ для всех желающих, то также подойдет рубрика Заказ спецтехники. Если аренда спецтехники предоставляется только для погрузки/разгрузки груза на территории ж/д тупика, то рубрику Заказ спецтехники НЕ УКАЗЫВАТЬ. Не путать с рубрикой Аренда помещений, Услуги складского хранения. Если адрес офиса и местоположение ж/д тупика отличаются, то необходимо указать все адреса с соответствующими описаниями к адресу.',
