    'comment': 'В данную рубрику следует вносить организации, которые проводят занятия по лечебной физкультуре. Лечебная физическая культура (ЛФК) – это комплекс дозированных физических упражнений на фоне правильного поставленного дыхания, направленных на лечение, восстановление и профилактику заболеваний опорно-двигательного аппарата, нервной системы и внутренних органов. Лечебная физкультура назначается только врачом и проводится строго по назначению (и под наблюдением) врача. Если в фитнес-клубе, спортивном центре проводятся занятия лечебной физкультурой, и посещать их можно всем желающим, независимо от других услуг (т.е. без покупки абонемента), то рубрика подходит. Занятия лечебной физкультурой могут проводиться с использованием тренажеров, поэтому НЕ ПУТАТЬ с рубриками Тренажёрные залы, Велнес-залы! Если организация проводит занятия по лечебной физкультуре только в комплексе с массажем и / или физиотерапией, рубрика не подходит.',
