    'name': 'Дизайн / моделирование ювелирных изделий',
    'comment': 'В данную рубрику следует вносить организации, которые оказывают услуги разработки дизайна, моделирования ювелирных изделий ОТДЕЛЬНО от услуг их изготовления. Как правило, результатом работы является создание материальной полноразмерной модели (прототипа) ювелирного изделия (она может быть создана как традиционными методами, так и с помощью компьютерных технологий: 3D моделирования, 3D печати), которая необходима для дальнейшего производства готовых изделий. Если организация оказывает услуги дизайна и моделирования ТОЛЬКО совместно с услугой изготовления ювелирных изделий, то рубрика НЕ ПОДХОДИТ. Указывать рубрику Ремонт / изготовление ювелирных изделий. Если организация оказывает услуги 3D печати ювелирных изделий только в комплексе с услугами дизайна, моделирования, то дополнительно рубрику Изготовление макетов / Прототипирование НЕ УКАЗЫВАТЬ! Если организация оказывает услуги 3D печати любых предметов для любого желающего (как правило, с помощью 3D сканирования), то допустимо указывать дополнительно рубрику Изготовление макетов / Прототипирование. Если организация оказывает только услуги обучения 3D моделирования, то рубрика НЕ ПОДХОДИТ. НЕ ПУТАТЬ с рубриками Изготовление макетов / Прототипирование, Ювелирные изделия, Ремонт / изготовление ювелирных изделий.',
    'keywords': '3D дизайн ювелирных изделий, 3D модели ювелирных изделий, 3D моделирование ювелирных изделий, 3D печать моделей ювелирных изделий, Восковые модели ювелирных изделий, Дизайн ювелирных изделий, Модели ювелирных изделий, Моделирование ювелирных изделий, Прототипирование ювелирных изделий, Прототипы ювелирных изделий, Разработка 3D модели ювелирных изделий, Создание 3D моделей ювелирных изделий, Создание восковых моделей ювелирных изделий, Создание моделей ювелирных изделий, Трёхмерная печать моделей ювелирных изделий, Трёхмерное моделирование ювелирных изделий, Трёхмерный дизайн ювелирных изделий',
