    'comment': 'В данную рубрику следует вносить организации, которые сдают в аренду мебель / посуду для проведения различного рода мероприятий: банкетов, конференций, выездных торжеств и т.п. Если организация сдает в аренду мебель / посуду всем желающим (отдельно от других видов услуг), то рубрика подходит. Если организация сдает в аренду мебель / посуду только в комплексе с другими услугами (например, проведение банкета, организация праздника и т.п.), то рубрика не подходит. Не указывать дополнительные рубрики по производству и продаже мебели / посуды, если компания оказывает только услуги по аренде мебели / посуды. Не путать с рубриками Аренда шатров / сценических конструкций для мероприятий, Организация и проведение праздников, Кейтеринг, Организация выставок.',
