    'comment': 'Вносить станции (автоматы, терминалы) для платной / бесплатной зарядки мобильных телефонов и планшетов. Автоматам по аренде аккумуляторов к мобильным телефонам (power bank) рубрика подходит, при этом указать говорящее расширение. Обычно такие терминалы располагаются на вокзалах, в аэропортах, на станциях метро, в торговых центрах. Данные станции оснащены шнурами / USB-портами для моб. устройств различных марок (iPhone, Xiaomi, Samsung и т.п). Если, помимо шнуров, станции также оборудованы стандартными розетками (как правило, в метро), то рубрика подходит. Могут иметь ячейки для хранения на период зарядки устройства. НЕ СТАВИТЬ дополнительные рубрики! НЕ СТАВИТЬ рубрику и не выносить отдельные карточки для кафе, ресторанов, магазинов и т.п. организаций, в которых есть обычные розетки (или power bank) для зарядки мобильных устройств посетителей.',
