    'comment': 'Пекарня - небольшое предприятие по выпечке и реализации на месте хлебобулочных изделий. В пекарне присутствует хотя бы один вид хлеба собственного производства или лепешка из тандыра, а также есть витрина со свежей выпечкой (булочки, пирожки и др.) НЕ СТАВИТЬ с рубриками Гипермаркеты, Продуктовые магазины, Супермаркеты, Точки кофе, Фудкорты, Хлебобулочные изделия. Допустимо указывать с рубриками Кафе, Кофейни, Кулинарии ТОЛЬКО при соблюдении условий из документа Правила работы и критерии указания / сочетания рубрик общественного питания. Если в продовольственном магазине / супермаркете есть своя пекарня, то необходимо указать ДА Пекарня. Если в пекарне продается кофе на вынос, рубрику Точки кофе не указывать, имеется ДА Кофе с собой. Если организация выпекает хлебобулочные изделия из заготовок с целью последующей реализации на месте, рубрика также подходит. Если организация только продает продукцию (нет производства на месте), то рубрика НЕ ПОДХОДИТ, указывать рубрики по ассортименту. Если организация производит хлебобулочные изделия и выпечку в промышленных масштабах (например, хлебзавод) и нет реализации для всех желающих, то рубрика НЕ ПОДХОДИТ.',
    'keywords': 'Баранки, Бездрожжевой хлеб, Бублики, Булочные, Выпечка, Каравай, Куличи, Купить батон, Купить баурсаки, Купить булочки, Купить круассаны, Купить курник, Купить слойки, Лаваш, Мучные изделия, Перекусить, Пироги, Пирожки, Свежая выпечка, Свежий хлеб, Сосиски в тесте, Творожные ватрушки, Хлеб, Хлеб на закваске, Хлебобулочные изделия, Чай с собой',
