    'comment': 'В данную рубрику следует вносить организации, которые занимаются переработкой / продажей / перевозкой газа. Топливный газ применяется в качестве горючего для отопления жилых зданий, как топливо для машин, котельных, ТЭЦ, различной техники и др. НЕ СТАВИТЬ с рубриками Заправочные станции, Автогазозаправочные станции, Мобильные АЗС.',
