    'name': 'Услуги лимфолога',
    'comment': 'Вносить медицинские центры, у которых ведется прием лимфолога. Врач лимфолог – специалист, который занимается профилактикой, диагностикой и лечением заболеваний лимфатической системы. Лимфатическая система - сеть сосудов, тканей и органов, которая служит источником клеток, обеспечивающих иммунитет, фильтрующим комплексом, переносчиком жиров и других веществ, а также дренажной системой, способствующей возвращению избытка тканевой жидкости в кровь. НЕ ПУТАТЬ с рубрикой Услуги флеболога.',
