    'comment': 'Вносить Залоговые фонды. Залоговый фонд - это новый механизм поддержки инвесторов. Суть его в том, что инвесторы, реализующие социально значимые проекты, могут получить господдержку в виде предоставления имущества и имущественных прав на объекты региональной и муниципальной собственности для залога по банковским кредитам Допустимо указывать с рубриками Администрация области / края, Микрофинансирование, Федеральные казначейства, Коворкинг',
    'keywords': '',
    'second_level_name': 'Общественные / политические организации',
    'first_level_name': 'Город / Власть',
