    'name': 'Школы приёмных родителей',
    'comment': 'Вносить частные либо государственные школы приемных родителей К данным компаниям онносятся: -органы опеки и попечительства; - и (или) образовательные организации; - медицинские организации; - организации, оказывающие социальные услуги; - иные организации (некоммерческими организациями, специализирующимися на оказании психолого-педагогической, социальной, правовой и иной помощи семьям, принявшим на воспитание детей, оставшихся без попечения родителей), которым органами опеки и попечительства переданы полномочия по подготовка граждан, выразивших желание стать опекунами к приему на воспитание детей-сирот и детей, оставшихся без попечения родителей. Это организации где опекуны (приёмные родители) проходят обучение по воспитанию ребёнка, изучают медицинские аспекты здоровья детей, проговаривают и прорабатывают психологические особенности приёмных детей. При усыновлении детей, взятии под опеку, создании приёмной семьи, желании стать патронатным воспитателем, прохождение школы приёмных родителей обязательно. У РД запрашиваем заверенную копию Решение органа опеки и попечительства о передаче организации полномочий (полномочия)',
